    false,nt"url": null,nt"notes": "The Light Detection and Ranging (LiDAR)
    LAS dataset is a survey of Mallory Swamp. These data were produced for SRWMD. The
    Mallory Swamp LiDAR Survey project area consists of approximately 72 square miles.
    The LiDAR point cloud was flown at a density sufficient to support a maximum final
    post spacing of 6 feet for unobscured areas. 3001 Inc. acquired 81 flightlines on
    May 16 degrees- 19, 2006. The data was divided into 5000' by 5000' foot cells that
    serve as the tiling scheme. The Mallory Swamp LiDAR Survey was collected under the
    guidance of a Professional Mapper/Surveyor. NOAA OCM removed the buffer in order
    to prevent duplication of points when processing DEMs. Little information was provided
    about neighboring R.O. Ranch.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
